pub enum Cw1155ExecuteMsg {
    SendFrom {
        from: String,
        to: String,
        token_id: TokenId,
        value: Uint128,
        msg: Option<Binary>,
    },
    BatchSendFrom {
        from: String,
        to: String,
        batch: Vec<(TokenId, Uint128)>,
        msg: Option<Binary>,
    },
    Mint {
        to: String,
        token_id: TokenId,
        value: Uint128,
    },
    BatchMint {
        to: String,
        batch: Vec<(TokenId, Uint128)>,
        msg: Option<Binary>,
    },
    Burn {
        from: String,
        token_id: TokenId,
        value: Uint128,
    },
    BatchBurn {
        from: String,
        batch: Vec<(TokenId, Uint128)>,
    },
    ApproveAll {
        operator: String,
        expires: Option<Expiration>,
    },
    RevokeAll {
        operator: String,
    },
}
